var image1=new Image();

var canvas = document.getElementById("preimg");
var ctx = canvas.getContext("2d");

function imageget(obj) {
    var file = obj.files[0];
    var reader = new  FileReader();
    reader.readAsDataURL(file);

    reader.onload = function (ev) {
        image1.src= ev.target.result;
        image1.onload = function(){
            //document.getElementById("headline").appendChild(image1);

            ctx.clearRect(0,0,300,300);
            var bili=300/document.querySelector("#ibili").value;
            ctx.drawImage(image1,0,0,bili,bili,0,0,300,300);
            image1.sX=0;
            image1.sY=0;
        }
        
    }
 }


 document.querySelector("#ibili").oninput = function (e) {
    var value = e.target.value;
    bili=300/value;
    ctx.clearRect(0,0,300,300);
    ctx.drawImage(image1,image1.sX,image1.sY,bili,bili,0,0,300,300);
}

